import { createTheme } from "@material-ui/core";



export const darkTheme = createTheme({
    palette: {
        mode: 'dark',
        /* primary: {
            main: '#082032'
        },
        secondary: {
            main: '#FF4C29'
        },
        background: {
            default: '#2C394B',
            paper: '#2C394B',
            card: '#2C394B'
          },  */
    }
});

export const lightTheme = createTheme({
    palette: {
        primary: {
        main: '#FEA82F'
        },
        secondary: {
        main: '#FF6701'
        }
    }  
});
